うっとりなため息が止まりません…😌

風味豊かなこっくりとしたマスカルポーネの大地に息づく生命。フルーツやハーブたちが香り高く美しく、そして繊細に咲き誇ります。

香りを限りなく大切にされるお二方(とのことで)ならではの複雑な重なり合いと広がりがとても素敵でした。

青木シェフの エッセンシャルオイルを用いた「香るデザート」の世界観を、コースで感じてみたいです😌♡

